       class ResidentAPI extends RESTDataSource {
  constructor() {
    super();
    this.baseURL = 'http://localhost:3000/';
  }

  async getAllResidents() {
    return this.get('residents');
  }

  async getAResident(idNumber) {
    const result = await this.get('residents/'+idNumber);

    return result;
  }
};

